webpackJsonp([0xf257fcafae70],{1705:function(a,e){a.exports={data:{markdownRemark:{html:"<p>오늘의 국경일, 베이징의 국경일 수도의 저녁은 매우 따뜻하고 웅장하며, 그 어느 때보 다 더 따뜻하게 보입니다. 광장은 밝은 조명, 화려한 꽃, 군중, 유행어, 웃음, 환희 경례, 불꽃 놀이, 춤, 노래, 모든 방향에서 왔습니다. 올해의 불꽃 놀이는 특히 많았고 특히 좋았습니다. 과거에는 볼 수 없었던 품종이 많았습니다. 하늘에서 넓은 지역을 덮고 매우 아름답습니다. 우리를 반성하고 지구에 빛을 발하고 하늘을 비추었습니다.</p>\n<p>한 국가가 자체적 인 성대한 의식을 가져야하며, 이것은 국가가 국가의 완전성과 국가 위대함을 느끼는 가장 좋은 방법입니다. 전국의 사람들은 종종 일상 생활에 흩어 지거나 소그룹에서 전반적인 느낌이 강하지 않습니다.</p>\n<p>각 종족 집단은 일상 생활에서 문화적, 경제적, 예술적 연관성을 가진 경우가 많으며, 국가 전체의 성대한 의식은 사람들에게 더 중요한 것을 알려줄 수 있습니다. 이것은 영적 실체와 정치 사이의 연결입니다. 따라서 세계의 많은 국가들이 그들의 국가 의식에 큰 관심을 기울이고 있으며, 국경일이 가장 좋은 기회입니다.</p>",id:"/home/swain/workspace/political-life/src/pages/ko/0152.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0152.md",frontmatter:{title:"10월 1일 토요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0152.md absPath of file >>> MarkdownRemark"}}}});
